import React, { useState, useEffect } from 'react';
import { Card, CardContent, CardHeader, CardTitle } from '../../components/ui/card';
import { Button } from '../../components/ui/button';
import { Input } from '../../components/ui/input';
import { Badge } from '../../components/ui/badge';
import { Table, TableBody, TableCell, TableHead, TableHeader, TableRow } from '../../components/ui/table';
import { Dialog, DialogContent, DialogHeader, DialogTitle, DialogFooter, DialogDescription } from '../../components/ui/dialog';
import { Label } from '../../components/ui/label';
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from '../../components/ui/select';
import { Tooltip, TooltipContent, TooltipProvider, TooltipTrigger } from '../../components/ui/tooltip';
import { Switch } from '../../components/ui/switch';
import { useToast } from '../../hooks/use-toast';
import adminService from '../../services/adminService';
import {
  Users,
  Plus,
  Trash2,
  Eye,
  CheckCircle,
  XCircle,
  Search,
  Filter,
  Mail,
  User,
  Key,
  UserCheck,
  UserX,
  Shield,
  ShieldCheck,
  ShieldOff,
  CreditCard,
  BarChart3,
  Activity,
  Calendar,
  Edit3,
  MoreVertical,
  Download,
  RefreshCw,
  AlertTriangle,
  Info,
  Crown,
  Star,
  TrendingUp,
  Lock,
  Unlock,
  Phone,
  IdCard,
  FileText,
  Clock,
  CheckSquare,
  XSquare,
  Settings,
  Wallet,
  DollarSign,
  PieChart
} from 'lucide-react';

const AdminUsers = () => {
  const { toast } = useToast();
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [pagination, setPagination] = useState({ page: 1, limit: 20, total: 0 });
  const [search, setSearch] = useState('');
  const [kycFilter, setKycFilter] = useState('all');
  const [statusFilter, setStatusFilter] = useState('all');
  const [showCreateDialog, setShowCreateDialog] = useState(false);
  const [showDetailDialog, setShowDetailDialog] = useState(false);
  const [selectedUser, setSelectedUser] = useState(null);
  const [actionLoading, setActionLoading] = useState(null);

  const [formData, setFormData] = useState({
    email: '',
    username: '',
    password: '',
    full_name: '',
    phone: '',
    is_verified: false,
    is_active: true,
    is_premium: false
  });

  useEffect(() => {
    fetchUsers();
  }, [pagination.page, search, kycFilter, statusFilter]);

  const fetchUsers = async () => {
    try {
      setLoading(true);
      const params = {
        page: pagination.page,
        limit: pagination.limit,
      };

      if (search) params.search = search;
      if (kycFilter && kycFilter !== 'all') params.kyc_status = kycFilter;
      if (statusFilter && statusFilter !== 'all') params.is_active = statusFilter === 'active';

      const data = await adminService.getUsers(params);
      setUsers(data.users || []);
      setPagination(prev => ({ ...prev, total: data.total, pages: data.pages }));
    } catch (error) {
      toast({
        title: 'Error',
        description: error.response?.data?.detail || 'Failed to fetch users',
        variant: 'destructive',
        icon: <AlertTriangle className="w-5 h-5" />
      });
    } finally {
      setLoading(false);
    }
  };

